import Footer from "./components/Footer";
import Home from "./pages/Home";
import React from "react";
import { Route } from "react-router-dom";

function App() {
	return (
		<React.Fragment>
			<Routes>
				<Route exact path="/" component={Home} />
			</Routes>
			<Footer />
		</React.Fragment>
	);
}

export default App;
